import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { Container, Button, Card, Form } from "react-bootstrap";
import "bootstrap";

const FormAddUser = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [nip, setNip] = useState("");
  const [jab, setJab] = useState("");
  const [password, setPassword] = useState("");
  const [confPassword, setConfPassword] = useState("");
  const [role, setRole] = useState("");
  const [msg, setMsg] = useState("");
  const navigate = useNavigate();

  const saveUser = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://localhost:5000/users", {
        name: name,
        email: email,
        nip: nip,
        jab: jab,
        password: password,
        confPassword: confPassword,
        role: role,
      });
      navigate("/users");
    } catch (error) {
      if (error.response) {
        setMsg(error.response.data.msg);
      }
    }
  };
  return (
    <Container fluid className="d-flex flex-column align-items-center">
      <div className="d-flex flex-column mt-2">
        <h2>Form User</h2>
      </div>
      <Card className="d-flex flex-column p-5 w-50" style={{ borderRadius: "1.2rem" }}>
        <p>Masukkan data Pegawai pada form yang disediakan</p>
        <div className="content">
          <Form onSubmit={saveUser}>
            <Form.Group className="mb-3" controlId="formBasicName">
              <Form.Label>Nama</Form.Label>
              <Form.Control type="text" placeholder="Masukkan Nama" />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formBasicEmail">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="Enter email" />
              <Form.Text className="text-muted">We'll never share your email with anyone else.</Form.Text>
            </Form.Group>
            <p className="has-text-centered">{msg}</p>
            <div className="field">
              <label className="label">Name</label>
              <div className="control">
                <input type="text" className="input" value={name} onChange={(e) => setName(e.target.value)} placeholder="name" />
              </div>
            </div>
            <div className="field">
              <label className="label">Email</label>
              <div className="control">
                <input type="text" className="input" value={email} onChange={(e) => setEmail(e.target.value)} placeholder="email" />
              </div>
            </div>
            <div className="field">
              <label className="label">NIP</label>
              <div className="control">
                <input type="text" className="input" value={nip} onChange={(e) => setNip(e.target.value)} placeholder="NIP" />
              </div>
            </div>
            <div className="field">
              <label className="label">Jabatan</label>
              <div className="control">
                <input type="text" className="input" value={jab} onChange={(e) => setJab(e.target.value)} placeholder="Jabatan" />
              </div>
            </div>
            <div className="field">
              <label className="label">Password</label>
              <div className="control">
                <input type="password" className="input" value={password} onChange={(e) => setPassword(e.target.value)} placeholder="******" />
              </div>
            </div>
            <div className="field">
              <label className="label">Confirm Password</label>
              <div className="control">
                <input type="password" className="input" value={confPassword} onChange={(e) => setConfPassword(e.target.value)} placeholder="******" />
              </div>
            </div>
            <div className="field">
              <label className="label">Role</label>
              <div className="control">
                <div className="select isfullwidth">
                  <select value={role} onChange={(e) => setRole(e.target.value)}>
                    <option value="admin">Admin</option>
                    <option value="user">User</option>
                  </select>
                </div>
              </div>
            </div>
            <div className="field">
              <div className="control">
                <Button type="submit" className="">
                  Save
                </Button>
              </div>
            </div>
          </Form>
        </div>
      </Card>
    </Container>
  );
};

export default FormAddUser;
